import React from 'react';
import './App.css';
import Home from './components/Home';
import { BrowserRouter, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
          <Route path='/' element={<Home/>}>
          </Route>

      </BrowserRouter>
    </div>
  );
}

export default App;
